import React from "react";
import "./Logo.css";

const Logo = () => {
  return (
    <h1 className="logo font-weight-bold">
            <span className="logo_first color_primary"> <img src="assets/user/images/logoo.png" alt="" style={{position: "absolute",marginTop:"-10px",maxWidth:"100px" }}/>
        
      
      </span>
   
    </h1>
  );
};

export default Logo;
